    "Blade Vibration Measurement System for Characterization of Closely Spaced Modes
    and Mistuning Project",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-05-06T21:42:33.454908",nt"name": "blade-vibration-measurement-system-for-characterization-of-closely-spaced-modes-and-mistun",nt"isopen":
    true,nt"url": null,nt"notes": "There are several ongoing challenges in
    non-contacting blade vibration and stress measurement systems that can address closely
    spaced modes and blade-to-blade variations (mistuning).  Traditional NSMS systems
    are applicable but have limitations due to the undersampling that is inherent in
    time-of-arrival data processing and the uncertainty that is introduced by inferring,
    as opposed to calculating, the mode of vibration.  rnrnBased on Navy SBIR research,
    MSI is developing a radar-based blade vibration measurement system with the following
    capabilities:rn?Provides a continuous time series of blade displacement data over
    a portion of a revolution (solving the undersampling problem).rn?Includes data reduction
    algorithms to directly calculate the blade vibration frequency, modal displacement,
    and vibratory stress (solving the mode inference problem).rn?Uses a single sensor
    per stage to monitor all of the blades on the stage.rnrnThe goals for the proposed
    project are to design and construct an innovative blade vibration measurement system
    with resolution capable of characterizing mistuning parameters and closely spaced
    modes of vibration.  Development and demonstration of such a system will provide
    substantially superior capabilities to current blade vibration technology.  Phase
    I demonstration testing will be conducted in MSI's laboratory with an existing instrumented
    compressor rig.  rn",nt"license_title": "U.S. Government Work",nt"extras":
